import { people } from '../../data/people';

export const SearchReult = (choose = '') => {

  if( choose === ''){
      return [];
  }
  const LowerCaseChoose = choose.toLowerCase(); 
  return people.filter( ( value ) => (
        value.name.toLowerCase().includes(LowerCaseChoose) ||
        value.email.toLowerCase().includes(LowerCaseChoose)||
        value.username.toLowerCase().includes(LowerCaseChoose) ||
        value.phone.toLowerCase().includes(LowerCaseChoose)
  ))
}
